import React, { ReactComponentElement } from 'react';

type BenefitProps = {
  title: string,
  icon: ReactComponentElement<any>,
  body: string,
};

const Benefit: React.FC<BenefitProps> = ({ title, body, icon }: BenefitProps) => (
  <div>
    {icon}
    <div>
      {title}
    </div>
    <div>
      {body}
    </div>
  </div>
);

export default Benefit;
